                    <Route path="/postTest" component={PotsTest}/>
                    <Route path="/placeForm" component={Place}/>
                    <Route path="/language" component={Language}/>
                </Switch>
            </Router>

            // {/* </React.Fragment> */
        );
    }
}

export default App;
